@iqthon.on(admin_cmd(pattern="رسم قلوب(?:\s|$)([\s\S]*)"))  
async def itachi(event):
    "To get emoji art text."
    args = event.pattern_match.group(1)
    get = await event.get_reply_message()
    if not args and get:
        args = get.text
    if not args:
        await edit_or_reply(
            event, "**⌔︙ قم بكتابه الكلمه بجانب الامر **"
        )
        return
    result = ""
    for a in args:
        a = a.lower()
        if a in emojify.kakashitext:
            char = emojify.kakashiemoji[emojify.kakashitext.index(a)]
            result += char
        else:
            result += a
    await edit_or_reply(event, result)
@iqthon.on(admin_cmd(pattern="رسم شعار(?:\s|$)([\s\S]*)"))  
async def itachi(event):
    args = event.pattern_match.group(1)
    get = await event.get_reply_message()
    if not args and get:
        args = get.text
    if not args:
        return await edit_or_reply(
            event, "**⌔︙ قم بكتابه الكلمه بجانب الامر **"
        )
    try:
        emoji, arg = args.split(" ", 1)
    except Exception:
        arg = args
        emoji = "8"
    result = ""
    for a in arg:
        a = a.lower()
        if a in emojify.kakashitext:
            char = emojify.itachiemoji[emojify.kakashitext.index(a)].format(cj=emoji)
            result += char
        else:
            result += a
    await edit_or_reply(event, result)
@iqthon.on(admin_cmd(pattern="بنك( الاعلى|$)"))  
async def _(event):
    "To check ping"
    flag = event.pattern_match.group(1)
    start = datetime.now()
    if flag == " الاعلى":
        catevent = await edit_or_reply(event, "**⌔︙ جاري قياس البنك  📶..**")
        await asyncio.sleep(0.3)
        await catevent.edit("**⌔︙ جاري قياس البنك  📶..**")
        await asyncio.sleep(0.3)
        await catevent.edit("**⌔︙ جاري قياس البنك  📶..**")
        end = datetime.now()
        tms = (end - start).microseconds / 1000
        ms = round((tms - 0.6) / 3, 3)
        await catevent.edit(f"**⌔︙ سرعه الاستجابة للبنك هيه  📶 :**  `{ms} بالثانية`  ")
    else:
        catevent = await edit_or_reply(event, "Pong!")
        end = datetime.now()
        ms = (end - start).microseconds / 1000
        await catevent.edit(f"**⌔︙ سرعه الاستجابة للبنك هيه  📶 :**  `{ms} بالثانية`  ")
